--
-- Name: trg_user_summary_on_partner(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.trg_user_summary_on_partner() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  IF TG_OP = 'INSERT' THEN
    UPDATE user_summary
       SET partners_count = partners_count + 1
     WHERE user_id = NEW.partner_id;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE user_summary
       SET partners_count = partners_count - 1
     WHERE user_id = OLD.partner_id;
  END IF;

  RETURN NULL;
END;
$$;


