--
-- Name: trg_user_summary_on_reinvest(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.trg_user_summary_on_reinvest() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  uid INTEGER;
BEGIN
  -- найдём user_id через таблицу пакетов → транзакции
  SELECT t.user_id INTO uid
    FROM itc_packages p
    JOIN transactions t ON t.uuid = p.uuid
   WHERE p.uuid = COALESCE(NEW.package_uuid, OLD.package_uuid);

  IF TG_OP = 'INSERT' THEN
    UPDATE user_summary
       SET reinvests_sum = reinvests_sum + NEW.amount
     WHERE user_id = uid;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE user_summary
       SET reinvests_sum = reinvests_sum - OLD.amount
     WHERE user_id = uid;
  END IF;

  RETURN NULL;
END;
$$;


