--
-- Name: trg_user_summary_on_reinvest_withdraw(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.trg_user_summary_on_reinvest_withdraw() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  uid  INTEGER;
  amt  NUMERIC;
BEGIN
  SELECT
     t.user_id,
     rpr.amount
    INTO uid, amt
    FROM itc_packages p
    JOIN transactions t
      ON t.uuid = p.uuid
    JOIN package_profit_reinvests rpr
      ON rpr.uuid = COALESCE(NEW.reinvest_uuid, OLD.reinvest_uuid)
   WHERE p.uuid = rpr.package_uuid;

  IF TG_OP = 'INSERT' THEN
    UPDATE user_summary
       SET reinvests_sum = reinvests_sum - amt
     WHERE user_id = uid;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE user_summary
       SET reinvests_sum = reinvests_sum + amt
     WHERE user_id = uid;
  END IF;

  RETURN NULL;
END;
$$;


